import Style from "./WeatherIcon.module.css";
import React from 'react';

export default class WeatherIcon extends React.Component {
    constructor(props) {
        super(props)
    }

    render() {
        return <img className={Style.weatherIcon} src={(this.props.icon == null) ? "/Assets/Spinner-1s-24px.svg" : `http://openweathermap.org/img/wn/${this.props.icon}.png`} />;
    }
}
